<script>
import { ref } from "vue";
import rulesVue from "src/components/rules.vue";
import { useQuasar, LocalStorage } from "quasar";
import methodsVue from "src/components/methods.vue";
import webViewerVue from "src/components/webViewer.vue";

export default {
  components: {
    methods: methodsVue,
    webViewer: webViewerVue,
    rulesVue,
  },
  data() {
    return {
      ventas: [
        { label: "VISIBLE", value: "C" },
        { label: "NO VISIBLE", value: "A" },
      ],
      reportes: [
        { label: "GPA", value: "C", slot: 'one'},
        { label: "APZ", value: "S", slot: 'two' },
        { label: "MAD", value: "A", slot: 'three' },
      ],
      costos: [
        { label: "CARGA NETA", value: "C", slot: 'one'},
        { label: "SIN CARGA NETA", value: "S", slot: 'two'},
      ],
      selectedReport: "C",
      selectedVenta: "A",
      selectedCosto: "S",
      agencias: [],
      agenciasSelected: [],
      selectedAgencia: [],
      base64:
        "",
    };
  },
  setup() {
    const $q = useQuasar();
    return {
      loading: ref(false),
      separator: ref("vertical"),
      dialog: ref(false),
    };
  },
  mounted() {
    this.$emit(
      "changeTitle",
      "SCEN - Mantenimiento - RelaciÃ³n de Despacho",
      ""
    );
    this.$refs.methods.getData("/agencias", "setDataInit", "agencias");
    this.$refs.webViewer.showpdf(this.base64);

    this.$refs.methods.getData("/rpermisos", "setDataPermisos", "rpermisos", {
      headers: {
        rol: LocalStorage.getItem("tokenTraducido").usuario.roles.id,
        menu: "relaciondespacho",
      },
    });
  },
  methods: {
    // Metodo para filtrar opciones de Selects
    filterArray(val, update, pagina, array, element) {
      if (val === "") {
        update(() => {
          this[pagina] = this[array];
        });
        return;
      }
      update(() => {
        const needle = val.toUpperCase();
        var notEqual = [];
        for (var i = 0; i <= this[array].length - 1; i++) {
          if (this[array][i][element].indexOf(needle) > -1) {
            notEqual.push(this[array][i]);
          }
          if (i == this[array].length - 1) {
            this[pagina] = notEqual;
            break;
          }
        }
      });
    },
    // Metodo para Setear Datos Permisos
    setDataPermisos(res, dataRes) {
      this[dataRes] = res;
      if (this.rpermisos.findIndex((item) => item.acciones.accion == 1) < 0)
        this.$router.push("/error403");
    },

    // Metodo para Setear Datos Generales
    setDataInit(res, dataRes) {
      this[dataRes] = res.data ? res.data : res;
    },
  },
};
</script>

